import React from 'react';
import ThemeSwitch from './Componentes/ThemeSwitch';
import './index.css';
import Hero from './Componentes/Hero';
import Paralax from './Componentes/Paralax';
import Footer from './Componentes/Footer';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';  
import Notas from './Paginas/Notas';
import Otras from './Paginas/Otras';
import Layout from './Paginas/Layout';

function App() {
  return (
    <div className="App bg-light-background dark:bg-dark-background text-light-text dark:text-dark-text min-h-screen flex flex-col items-center">

        <header className="App-header p-4 w-full">
          <div className="flex justify-between items-center w-full max-w-4xl mx-auto">
            <h1 className="text-3xl font-bold mb-4 text-center w-full p-8">⚽ Futbol y Presidentes en Colombia ⚽</h1>
            <ThemeSwitch />
          </div>
        </header>
        <Router>
        <Routes>
          <Route path="/" element={<Layout />}>
            <Route path="notas" element={<Notas />} />
            <Route path="otras" element={<Otras />} />
          </Route>
        </Routes>
      </Router>
      <Hero />
      <Paralax />
      <Footer />
    </div>
  );
}

export default App;
